const express = require('express');
const routes = require('./routes/index');

const app = express();
const port = process.env.PORT || 5200;

app.listen(port, () => {
  console.log(`Server listening on port ${port}`);
});

app.use(express.json());
app.use(express.urlencoded({ extended: false }));
app.use(routes);

